import React, { useState } from "react";

import Note from "./components/notes";
import "./App.scss";


const App = () => {
  let [note, setNote] = useState([
    {
      id: 1,
      title: "Aprender HTML",
      completed: true
    },
    {
      id: 2,
      title: "Aprender CSS",
      completed: true,
    },
    {
      id: 3,
      title: "Aprender javaScript",
      completed: true
    },
    {
      id: 4,
      title: "Aprender React",
      completed: false
    }
  ])
	return (
		<div>
			<div className="container">
        <Note note={note}/>
      </div>
		</div>
	)
}

export default App;
